void dp_multimaptest::test12()
{
	this->set_subtitle( "constructor/assignment/destructor, data(int value) key - deep pointer(pointer) value" );

	// default constructor
	dnp_multimap<int,test*>	lr;
	AssertTrue( check_multimap( lr, { } ));

	// copy constructor
	dnp_multimap<int,test*>		p0( lr );
	const dnp_multimap<int,test*>	c0( lr );
	lr.emplace( 1, dpl( &t1 ) );
	dnp_multimap<int,test*>		p1( lr );
	const dnp_multimap<int,test*>	c1( lr );
	lr.emplace( 2, dpl( &t2 ) );
	lr.emplace( 3, dpl( &t3 ) );
	lr.emplace( 3, dpl( &t3 ) );
	lr.emplace( 3, dpl( &t3 ) );
	lr.emplace( 4, dpl( &t4 ) );
	lr.emplace( 5, dpl( &t5 ) );
	dnp_multimap<int,test*>		p5( lr );
	const dnp_multimap<int,test*>	c5( lr );

	AssertTrue( p0.empty());
	AssertTrue( check_multimap( p1, {{ 1, &t1 }} ));
	AssertTrue( check_multimap( p5, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 3, &t3 }, { 4, &t4 }, { 5, &t5 }} ));
	AssertTrue( c0.empty());
	AssertTrue( check_multimap( c1, {{ 1, &t1 }} ));
	AssertTrue( check_multimap( c5, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 3, &t3 }, { 4, &t4 }, { 5, &t5 }} ));

	// move constructor
	{
		dnp_multimap<int,test*>   lx = lr;
		dnp_multimap<int,test*>   ly( std::move( lx ));

		AssertTrue( lx.empty());
		AssertTrue( check_multimap( ly, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 },
						 { 3, &t3 }, { 4, &t4 }, { 5, &t5 }} ));
	}
	// copy assignment operator
	{
		dnp_multimap<int,test*>   lx;

		lx = p1;
		AssertTrue( check_multimap( lx, {{ 1, &t1 }} ));
		lx = p0;
		AssertTrue( lx.empty());
		lx = p5;
		AssertTrue( check_multimap( lx, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 },
						 { 3, &t3 }, { 4, &t4 }, { 5, &t5 }} ));
	}
	// move assignment operator
	{
		dnp_multimap<int,test*>   lx;

		lr = p1;
		lx = dnp_multimap<int,test*>( {{ 5, &t5 }, { 3, &t3 }, { 3, &t3 }, { 3, &t3 }, { 2, &t2 }} );// move assignment by r-value
		AssertTrue( check_multimap( lx, {{ 5, &t5 }, { 3, &t3 }, { 3, &t3 }, { 3, &t3 }, { 2, &t2 }} ));

		lx = std::move( lr );							// move assignment by std::move()
		AssertTrue( check_multimap( lx, {{ 1, &t1 }} ));
		AssertTrue( check_multimap( lr, {} ));					// not mandatory

		lx = std::move( lx );
		AssertTrue( check_multimap( lx, {} ));					// not mandatory
	}
	// iterator constructor
	{
		dnp_multimap<int,test*>   lx = p5;
		dnp_multimap<int,test*>::iterator	i = lx.find( 4 );

		dnp_multimap<int,test*>   x3( lx.begin(), i );
		AssertTrue( check_multimap( x3, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 3, &t3 }} ));
		dnp_multimap<int,test*>   x0( i, i );
		AssertTrue( x0.empty());
		dnp_multimap<int,test*>   x1( i, lx.end());
		AssertTrue( check_multimap( x1, {{ 4, &t4 }, { 5, &t5 }} ));
	}
	// initializer constructor/assignment operator
	{
		dnp_multimap<int,test*>   lx = p5;
		dnp_multimap<int,test*>   x0 { };
		dnp_multimap<int,test*>   x1 {{ 1, &t1 }};
		dnp_multimap<int,test*>   x5 {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 5, &t5 }};

		AssertTrue( x0.empty());
		AssertTrue( check_multimap( x1, {{ 1, &t1 }} ));
		AssertTrue( check_multimap( x5, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 5, &t5 }} ));

		lx = { };
		AssertTrue( lx.empty());
		lx = {{ 1, &t1 }};
		AssertTrue( check_multimap( lx, {{ 1, &t1 }} ));
		lx = {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 5, &t5 }};
		AssertTrue( check_multimap( lx, {{ 1, &t1 }, { 2, &t2 }, { 3, &t3 }, { 3, &t3 }, { 5, &t5 }} ));
	}
}

